-- postgresql
-- create new schema and set it as default
create schema best_selling_products;
set search_path to best_selling_products, "$user", public;

-- uncomment line below to remove schema
-- drop schema best_selling_products;
-- reset search_path;

-- Run all these to create tables and populate data

-- create table for products
create table products (
    product_id int primary key
    , product_name varchar(100) not null
    , sku int
    , distributor_id int not null
);

-- create table for orders
create table orders (
    order_id serial primary key
    , date varchar(10)
    , user_id int
    , product_id int not null
    , no_units int not null
    , price int not null
    , shipping_id int
    , region varchar(50)
    , foreign key (product_id) references products (product_id)
);


